import React, { useState } from 'react';
import '../../styles/RegisterPage/RegisterPage.css';
import { IoSpeedometerOutline } from "react-icons/io5";
import { Meta } from 'react-head';
import { useNavigate } from 'react-router-dom';

const RegisterPage = () => {
  const navigate = useNavigate();

  // Состояние полей
  const [form, setForm] = useState({
    name: '',
    email: '',
    phone: '',
    password: '',
    repeatPassword: '',
  });

  const [errors, setErrors] = useState({});

  // Обработка изменения
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // Валидация
  const validate = () => {
    const newErrors = {};

    if (!form.name.trim()) newErrors.name = 'Введите имя';
    if (!form.email.trim()) newErrors.email = 'Введите email';
    else if (!/\S+@\S+\.\S+/.test(form.email)) newErrors.email = 'Некорректный email';

    if (!form.phone.trim()) newErrors.phone = 'Введите телефон';
    if (!form.password) newErrors.password = 'Введите пароль';
    else if (form.password.length < 6) newErrors.password = 'Пароль слишком короткий';

    if (form.repeatPassword !== form.password) {
      newErrors.repeatPassword = 'Пароли не совпадают';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  // Подтверждение формы
  const handleSubmit = () => {
    if (validate()) {
      // Здесь можно отправить данные на сервер
      navigate('/emailconfirmationletter');
    }
  };

  return (
    <>
      <Meta name="viewport" content="width=device-width, initial-scale=1.0" />

      <div className="registration-background">
        <div className="registration-container">
          <h2 className="registration-title">
            Speedster <IoSpeedometerOutline style={{ fontSize: '28px', color: 'white' }} />
          </h2>

          <label className="registration-label">Name</label>
          <input
            type="text"
            name="name"
            className="registration-input"
            value={form.name}
            onChange={handleChange}
          />
          {errors.name && <div className="error-text">{errors.name}</div>}

          <label className="registration-label">E-mail</label>
          <input
            type="email"
            name="email"
            className="registration-input"
            value={form.email}
            onChange={handleChange}
          />
          {errors.email && <div className="error-text">{errors.email}</div>}

          <label className="registration-label">Phone number</label>
          <input
            type="tel"
            name="phone"
            className="registration-input"
            value={form.phone}
            onChange={handleChange}
          />
          {errors.phone && <div className="error-text">{errors.phone}</div>}

          <label className="registration-label">Password</label>
          <input
            type="password"
            name="password"
            className="registration-input"
            value={form.password}
            onChange={handleChange}
          />
          {errors.password && <div className="error-text">{errors.password}</div>}

          <label className="registration-label">Repeat password</label>
          <input
            type="password"
            name="repeatPassword"
            className="registration-input"
            value={form.repeatPassword}
            onChange={handleChange}
          />
          {errors.repeatPassword && <div className="error-text">{errors.repeatPassword}</div>}

          <button className="registration-button" onClick={handleSubmit}>
            Complete registration
          </button>
        </div>
      </div>
    </>
  );
};

export default RegisterPage;
